import React from 'react';
import IMessage from '../alias/IMessage';

interface IRemovedMemberNotification{
    message: IMessage;
}

const RemovedMemberNotification : React.FC<IRemovedMemberNotification> = ({ message }) => {
    return(
        <div
        style={{
            color: 'red'
        }}    
        >
        {message}
        </div>
    );
}

export default RemovedMemberNotification;
